script: |
  super -f text -I q8201.spq | sort > q8201.out

inputs:
  - name: q8201.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT + 35 BETWEEN - - col0 AND + 93 - + + 11 + 36 * - - 87 * - CAST ( NULL AS INTEGER ) / - 1 * - col2;
  - name: tab1

outputs:
  - name: q8201.out
    data: |
      51	14	96
      85	5	59
      91	47	68
